import numpy as np
import tensorflow as tf
from Classifier import Classifier

class DNN(Classifier):

    def buildClassifier(self, audio_feature, audio_label):

        audio_label=[0 if label=='genuine' else 1 for label in audio_label]
        audio_label=np.array(audio_label)
        print(audio_feature.shape)
        feature_columns = [tf.feature_column.numeric_column("x", shape=[1, 312])]

        # Build 2 layer DNN classifier
        classifier = tf.estimator.DNNClassifier(
            feature_columns=feature_columns,
            hidden_units=[312, 32],
            optimizer=tf.train.AdamOptimizer(1e-4),
            n_classes=2,
            dropout=0.1,
            model_dir="./tmp/mnist_model"
        )

        # Define the training inputs
        train_input_fn = tf.estimator.inputs.numpy_input_fn(
            x={"x": audio_feature},
            y=audio_label,
            num_epochs=None,
            batch_size=40,
            shuffle=True
        )

        classifier.train(input_fn=train_input_fn, steps=10000)

        return classifier




    def predict(self, audio_feature, clf):

        predict_input_fn = tf.estimator.inputs.numpy_input_fn(
            x={"x": audio_feature},
            y=None,
            num_epochs=1,
            shuffle=False
        )

        label_predict=clf.predict(input_fn=predict_input_fn)
        label_predict=list(label_predict)
        predict_list=[label_predict[i]['classes'][0] for i in range(len(label_predict))]
        predict_list=['genuine' if label == '0' else 'spoof' for label in predict_list]

        label_predict_proba=[label_predict[i]['probabilities'][0] for i in range(len(label_predict))]


        return np.array(predict_list),np.array(label_predict_proba)


